// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

pragma abicoder v2;

import '@openzeppelin/contracts/utils/Address.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import '@openzeppelin/contracts/utils/Context.sol';

import './HyperXNFTCollection.sol';

contract HyperXNFTManage is Ownable, ReentrancyGuard {
    using Address for address;

    event AddCollection(uint, address);
    event RemoveCollection(uint, address);
    event TestEvent(uint);

    address[] private collections;
    mapping(address => bool) approveCollection;

    constructor(){
    }

    modifier onlyCreator() {
        require(owner() == _msgSender() || approveCollection[_msgSender()] == true, "Caller needs admin/creator privilege");
        _;
    }

    function isApprovedCollection(address eouser) public view returns (bool) {
        return approveCollection[eouser];
    }

    function setApproveCollection(address eouser, bool bApprove) external onlyOwner {
        require(!eouser.isContract(), "Only externally own account could manage collection");
        approveCollection[eouser] = bApprove;
    }

    function addCollection(address nftContractAddress) external onlyCreator returns (uint) {
        require(nftContractAddress.isContract(), "Not contract address");
        require(nftContractAddress != address(0), "address null");

        require(HyperXNFTCollection(nftContractAddress).owner() == _msgSender(), "caller is not owner of this contract");

        uint i = 0;
        uint nZeroIndex = collections.length;
        bool bFound = false;
        for (i = 0; i < collections.length; i ++) {
            if (collections[i] == nftContractAddress) {
                bFound = true;
            }
            if (nZeroIndex == collections.length && collections[i] == address(0)) {
                nZeroIndex = i;
            }

            if (bFound == true && nZeroIndex != collections.length)
                break;
        }

        require (i == collections.length, "this address already exists");
        if (nZeroIndex == collections.length) {
            collections.push(nftContractAddress);
        }
        else {
            collections[nZeroIndex] = nftContractAddress;
        }

        emit AddCollection(nZeroIndex, nftContractAddress);

        return nZeroIndex;
    }

    function removeCollection(address nftContractAddress) external onlyCreator returns (uint) {
        require(nftContractAddress.isContract(), "Not contract address");
        require(nftContractAddress != address(0), "address null");

        require(HyperXNFTCollection(nftContractAddress).owner() == _msgSender(), "caller is not owner of this contract");

        uint i = 0;
        bool bFound = false;
        for (i = 0; i < collections.length; i ++) {
            if (collections[i] == nftContractAddress) {
                collections[i] = address(0);
                bFound = true;
                break;
            }
        }

        require(bFound == true, "nft contract was not added");

        emit RemoveCollection(i, nftContractAddress);
        return i;
    }

    // for test only
    function getCollectionInfo() public view returns (address [] memory) {
        return collections;
    }
}
